DELIMITER //
CREATE PROCEDURE `PA_DAICapEmpleados`(IN jsonParametros JSON)
BEGIN
	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
	DECLARE 	strCodigo varchar(10) ;
	DECLARE		strDetalle varchar(255);	
	DECLARE		intEstatus INT ;
	DECLARE		intIdEmpleado BIGINT;
	DECLARE		intId			BIGINT;
    DECLARE		intIdPaquete	BIGINT;
    DECLARE 	dteFechaIngreso date;
    DECLARE		blnActivo		bit;
    DECLARE		intFirmaGafete 	bigint;
    DECLARE		dteFechaEntrega	date;
	DECLARE		intTallaCamisa	bigint;	
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle= MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle as strDetalle;
	END;
	DECLARE EXIT HANDLER FOR 99999
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle = MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle;
	END;
	SET  lc_time_names = 'es_ES';
	Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
   			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Empleado.EMP_FirmaGafete')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Empleado.EMP_Id')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Empleado.CAT_TallaCamisa'))
	INTO  strOpcion,strUsuario,intFirmaGafete,intIdEmpleado,intTallaCamisa;
    
    IF (strOpcion='G') THEN
		START TRANSACTION;
		SET AUTOCOMMIT=0;
		
		 Update dai_empleados EMPLEADOS
			Join ( select EMP_Id,CAT_TallaCamisa,CAT_TallaPantalon,EMP_Comentarios
             FROM JSON_TABLE(jsonParametros, '$.Empleado'
				COLUMNS (
		    EMP_Id  BIGINT PATH '$.EMP_Id', 
		    CAT_TallaCamisa bigint  PATH '$.CAT_TallaCamisa',
            CAT_TallaPantalon bigint  PATH '$.CAT_TallaPantalon',
		    EMP_Comentarios VARCHAR(150) PATH '$.EMP_Comentarios'
						)
			)AS TALLAS )  AS TALLAS 
				  on TALLAS.EMP_Id=EMPLEADOS.EMP_Id
        SET EMPLEADOS.CAT_TallaCamisa=TALLAS.CAT_TallaCamisa , EMPLEADOS.CAT_TallaPant=TALLAS.CAT_TallaPantalon,EMPLEADOS.EMP_ComentariosTomaTalla=TALLAS.EMP_Comentarios,EMPLEADOS.EMP_FechaTomaTalla=now();
  
      /* Update dai_empleados EMPLEADOS
			Join ( select EMP_Id,CAT_TallaSudadera,EMP_Comentarios
             FROM JSON_TABLE(jsonParametros, '$.Empleado'
				COLUMNS (
		    EMP_Id  BIGINT PATH '$.EMP_Id', 
		    CAT_TallaSudadera bigint  PATH '$.CAT_TallaSudadera',
		    EMP_Comentarios VARCHAR(150) PATH '$.EMP_Comentarios'
						)
			)AS TALLAS )  AS TALLAS 
				  on TALLAS.EMP_Id=EMPLEADOS.EMP_Id
        SET EMPLEADOS.CAT_TallaSudadera=TALLAS.CAT_TallaSudadera ,EMPLEADOS.EMP_ComentariosTomaTalla=TALLAS.EMP_Comentarios,EMPLEADOS.EMP_FechaTomaTalla=now();
            */
       
       COMMIT;

 /*
			Update dai_empleados set CAT_TallaCamisa=intTallaCamisa
			WHERE EMP_Id=intIdEmpleado;
            */
        Select 'ok' as strCodigo,'¡Información Guardada Correctamente!' as strDetalle;
        
	END IF;
    IF (strOpcion='C') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				IFNULL(TURNO.CAT_NOMBRE,'') AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO,
				IFNULL(TALLA_CAMISA.CAT_Clave,'') AS CAMISA,
				IFNULL(TALLA_PANTALON.CAT_Clave,'')AS PANTALON,
                IFNULL(TALLA_SUDADERA.CAT_Clave,'')AS SUDADERA,
                EMPLEADOS.EMP_ComentariosTomaTalla AS COMENTARIOS
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				Left Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Left JoIN dai_catalogos TALLA_CAMISA
					on TALLA_CAMISA.CAT_Id=ifnull(EMPLEADOS.CAT_TallaCamisa,0)
				Left JoIN dai_catalogos TALLA_PANTALON
					on TALLA_PANTALON.CAT_Id=ifnull(EMPLEADOS.CAT_TallaPant,0)
				Left JoIN dai_catalogos TALLA_SUDADERA
					on TALLA_SUDADERA.CAT_Id=ifnull(EMPLEADOS.CAT_TallaSudadera,0)
			Where EMPLEADOS.EMP_ACTIVO=1;
           	
	END IF;
	IF (strOpcion='CI') THEN
		Select EMPLEADOS.EMP_FechaIngreso,EMPLEADOS.PAQ_Id,EMPLEADOS.EMP_Activo,EMPLEADOS.EMP_Id,EMPLEADOS.EMP_FechaEntrega FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_FirmaGafete = intFirmaGafete or EMPLEADOS.EMP_Id=intIdEmpleado
        Into dteFechaIngreso,intIdPaquete,blnActivo,intIdEmpleado,dteFechaEntrega;
		
        IF (SELECT count(*) FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_Id = intIdEmpleado )=0 THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡No existe el empleado!';
		END IF;
       /*  IF  year(dteFechaIngreso)=YEAR(now())  THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡No se puede realizar la entrega por la fecha de ingreso!';
		END IF;
        */
        SELECT 		EMPLEADOS.EMP_Id as Id,
					EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
                    EMPLEADOS.EMP_FirmaGafete as FIRMA_GAFETE,
                    EMPLEADOS.EMP_Nombre	as NOMBRE_EMPLEADO,
                    AREA.CAT_NOMBRE			AS AREA,
                    PUESTO.CAT_NOMBRE 		AS PUESTO,
                    DATE_FORMAT(EMPLEADOS.EMP_FechaIngreso,"%d %M %Y") as FECHA_INGRESO
		FROM 		dai_empleados EMPLEADOS 			
					Join dai_catalogos AREA
						on AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						on PUESTO.CAT_Id=EMPLEADOS.CAT_PUESTO   
		WHERE		EMPLEADOS.EMP_Id=intIdEmpleado;
        
		 Select CATALOGO.CAT_Id as Id,
				CATALOGO.CAT_CLAVE AS NOMBRE
		From 	dai_catalogos_tipo CATALOGO_TIPO
				Join dai_catalogos CATALOGO
					on CATALOGO.CTT_Id=CATALOGO_TIPO.CTT_Id
				Join dai_catalogos_extras CATALOGO_EXTRA
					on CATALOGO_EXTRA.CAT_Id=CATALOGO.CAT_Id and CATALOGO_EXTRA.CAX_Tipo='Division' and CATALOGO_EXTRA.CAX_Valor='Top'
		Where	CATALOGO_TIPO.CTT_Clave='TALL'
		order by CATALOGO.CAT_Orden;
		
        Select 	CATALOGO.CAT_Id as Id,
				CATALOGO.CAT_CLAVE AS NOMBRE
		From 	dai_catalogos_tipo CATALOGO_TIPO
				Join dai_catalogos CATALOGO
					on CATALOGO.CTT_Id=CATALOGO_TIPO.CTT_Id
				Join dai_catalogos_extras CATALOGO_EXTRA
					on CATALOGO_EXTRA.CAT_Id=CATALOGO.CAT_Id and CATALOGO_EXTRA.CAX_Tipo='Division' and CATALOGO_EXTRA.CAX_Valor='Pant'
		Where	CATALOGO_TIPO.CTT_Clave='TALL'
		order by CATALOGO.CAT_Orden;
    END IF;
	

	
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAICapEntregas
DELIMITER //
CREATE PROCEDURE `PA_DAICapEntregas`(IN jsonParametros JSON)
BEGIN

	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
	DECLARE 	strCodigo varchar(10) ;
	DECLARE		strDetalle varchar(255);	
	DECLARE		intEstatus INT ;
	DECLARE		intIdEmpleado BIGINT;
	DECLARE		intId			BIGINT;
    DECLARE		intIdSalida		bigint;
    DECLARE		intIdPaquete	BIGINT;
    DECLARE 	dteFechaIngreso date;
    DECLARE		blnActivo		bit;
    DECLARE		intFirmaGafete 	bigint;
    DECLARE		dteFechaEntrega	date;
	DECLARE		intIdTalla		bigint;
    DECLARE		intIdPrenda		bigint;
    DECLARE 	intIdTallaCamisa bigint;
    DECLARE		intIdTallaPantalon bigint;
	DECLARE		intIdTallaSudadera bigint;
    DECLARE 	intCantidadPaquete bigint;
    DECLARE	 	intCantidadEntrega bigint;
    DECLARE		strComentariosEntrega varchar(150);
    DECLARE		strValeEntrega varchar(150);
    DECLARE		strTallaCamisa varchar(10);
    DECLARE		strTallaPantalon varchar(10);
    
	DECLARE EXIT HANDLER FOR SQLEXCEPTION 
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle= MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle as strDetalle;
	END;
	DECLARE EXIT HANDLER FOR 99999
	BEGIN 
		rollback;
		GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle = MESSAGE_TEXT;
		SELECT 200 as intEstatus,strCodigo,strDetalle;
	END;
	SET  lc_time_names = 'es_ES';
   select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario')),
			 JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.EMP_FirmaGafete')),
              JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.EMP_Id')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.PAQ_Id')) ,
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.IdTalla')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.IdPrenda')),
             JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.ENT_Comentarios')) ,
             JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.ENT_Vale')),
             JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Entrega.Id'))
	INTO  strOpcion,strUsuario,intFirmaGafete,intIdEmpleado,intIdPaquete,intIdTalla,intIdPrenda,strComentariosEntrega,strValeEntrega,intId;

    IF (strOpcion='CET') THEN
		Select 	EXISTENCIA.EXI_Cantidad AS CANTIDAD 
        From	dai_existencias EXISTENCIA 
        Where	EXISTENCIA.PRE_Id=intIdPrenda and EXISTENCIA.CAT_Talla=intIdTalla;
    END IF;
	IF (strOpcion='CIP') THEN
    	Select 	EMPLEADOS.CAT_TallaCamisa,
				EMPLEADOS.CAT_TallaPant ,
                TALLA_CAMISA.CAT_CLAVE ,
                TALLA_PANTALON.CAT_CLAVE
        FROM 	dai_empleados EMPLEADOS 
				Join dai_catalogos TALLA_CAMISA
					ON TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
				Join dai_catalogos TALLA_PANTALON
					ON TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
        WHERE  EMPLEADOS.EMP_Id=intIdEmpleado
        Into intIdTallaCamisa,intIdTallaPantalon,strTallaCamisa,strTallaPantalon;
		
		IF intIdTallaCamisa>0 THEN
			Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
                    CASE WHEN PRENDAS.PRE_CATEGORIA ='PLAYERA' THEN PRENDAS.PRE_CATEGORIA ELSE concat('CAMISA ',PRENDAS.PRE_SUBCATEGORIA) END AS CATEGORIA,
                    PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD,
					PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD_ENTREGA,
                    EXISTENCIAS.EXI_CANTIDAD AS EXISTENCIA,
                    intIdTallaCamisa as CAT_TALLA,
                    strTallaCamisa AS TALLA
			From	dai_paquetes_entrega_detalle PAQUETE_DETALLE
					Join dai_prendas PRENDAS
						ON PRENDAS.PRE_Id=PAQUETE_DETALLE.PRE_Id
					Join dai_existencias EXISTENCIAS
						ON EXISTENCIAS.PRE_Id=PRENDAS.PRE_Id and EXISTENCIAS.CAT_Talla=intIdTallaCamisa
					Left Join (
						Select 	DETALLE.PRE_Id,
								SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD
                        From 	dai_movimientos ENTREGA
								Join dai_movimientos_detalle DETALLE
									on ENTREGA.MOV_Id=DETALLE.MOV_Id
						Where	ENTREGA.EMP_iD=intIdEmpleado And ENTREGA.CAT_Tipo=55
                        Group by  	DETALLE.PRE_Id
						)as ENTREGA on ENTREGA.PRE_Id=PAQUETE_DETALLE.PRE_Id
			Where	PAQUETE_DETALLE.PAQ_Id=intIdPaquete AND PRENDAS.PRE_DIVISION='TOP' and (PAQUETE_DETALLE.PAD_CANTIDAD -ifnull(ENTREGA.CANTIDAD,0) )>0
            Union	all
            Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
                    PRENDAS.PRE_CATEGORIA  AS CATEGORIA,
                    PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD,
					PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD_ENTREGA,
                    EXISTENCIAS.EXI_CANTIDAD AS EXISTENCIA,
                    intIdTallaPantalon as CAT_TALLA,
                    strTallaPantalon AS TALLA
			From	dai_paquetes_entrega_detalle PAQUETE_DETALLE
					Join dai_prendas PRENDAS
						ON PRENDAS.PRE_Id=PAQUETE_DETALLE.PRE_Id
					Join dai_existencias EXISTENCIAS
						ON EXISTENCIAS.PRE_Id=PRENDAS.PRE_Id and EXISTENCIAS.CAT_Talla=intIdTallaPantalon
					Left Join (
						Select 	DETALLE.PRE_Id,
								SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD
                        From 	dai_movimientos ENTREGA
								Join dai_movimientos_detalle DETALLE
									on ENTREGA.MOV_Id=DETALLE.MOV_Id
						Where	ENTREGA.EMP_iD=intIdEmpleado And ENTREGA.CAT_Tipo=55
                        Group by  	DETALLE.PRE_Id
						)as ENTREGA on ENTREGA.PRE_Id=PAQUETE_DETALLE.PRE_Id
			Where	PAQUETE_DETALLE.PAQ_Id=intIdPaquete AND PRENDAS.PRE_DIVISION='PANT' and (PAQUETE_DETALLE.PAD_CANTIDAD -ifnull(ENTREGA.CANTIDAD,0) )>0;
        
        ELSE
			Select	PRENDAS.PRE_Id as Id,
					PRENDAS.PRE_NOMBRE AS NOMBRE,
                    CASE WHEN PRENDAS.PRE_CATEGORIA IN ('PANTALON','PLAYERA') THEN PRENDAS.PRE_CATEGORIA ELSE concat('CAMISA ',PRENDAS.PRE_SUBCATEGORIA) END AS CATEGORIA,
                    PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD,
					PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD_ENTREGA,
                    0 AS EXISTENCIA
                    
			From	dai_paquetes_entrega_detalle PAQUETE_DETALLE
					Join dai_prendas PRENDAS
						ON PRENDAS.PRE_Id=PAQUETE_DETALLE.PRE_Id
					Left Join (
						Select 	DETALLE.PRE_Id,
								SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD
                        From 	dai_movimientos ENTREGA
								Join dai_movimientos_detalle DETALLE
									on ENTREGA.MOV_Id=DETALLE.MOV_Id
						Where	ENTREGA.EMP_iD=intIdEmpleado And ENTREGA.CAT_Tipo=55
                        Group by  	DETALLE.PRE_Id
						)as ENTREGA on ENTREGA.PRE_Id=PAQUETE_DETALLE.PRE_Id
			Where	PAQUETE_DETALLE.PAQ_Id=intIdPaquete and (PAQUETE_DETALLE.PAD_CANTIDAD -ifnull(ENTREGA.CANTIDAD,0) )>0;

        END IF;
	END IF;
    IF (strOpcion='CEE') THEN
		Select		concat('FOLIO ',ENTREGA.MOV_Id) as FOLIO,
					ENTREGA.MOV_Id as Id,
					 DATE_FORMAT(ENTREGA.MOV_FechaHora,"%d %M %Y") as FECHA,
                    CONCAT( TIPO.CAT_NOMBRE,' ', ENTREGA.MOV_DOCUMENTO) as COMENTARIOS,
                     ENTREGA.MOV_USUARIO as USUARIO,
                     sum(DETALLE.MOD_CANTIDAD) AS CANTIDAD
        From		dai_movimientos ENTREGA
					Join dai_movimientos_detalle DETALLE
						ON ENTREGA.MOV_Id=DETALLE.MOV_Id
					Join dai_catalogos TIPO
						on TIPO.CAT_Id=ENTREGA.CAT_Tipo
		Where		ENTREGA.EMP_Id=intIdEmpleado AND ENTREGA.CAT_Tipo in (55,56,57)
        group	by ENTREGA.MOV_Id,ENTREGA.MOV_FechaHora,  ENTREGA.MOV_DOCUMENTO,ENTREGA.MOV_USUARIO,TIPO.CAT_NOMBRE;
	END IF;
      IF (strOpcion='CDE') THEN
		Select		PRENDA.PRE_NOMBRE AS PRENDA,
                     sum(DETALLE.MOD_CANTIDAD) AS CANTIDAD
        From		dai_movimientos ENTREGA
					Join dai_movimientos_detalle DETALLE
						ON ENTREGA.MOV_Id=DETALLE.MOV_Id
					Join dai_prendas PRENDA
						on PRENDA.PRE_Id=DETALLE.PRE_Id
		Where		ENTREGA.EMP_Id=intIdEmpleado AND ENTREGA.CAT_Tipo in (55)
        group	by PRENDA.PRE_NOMBRE;
	END IF;
    IF (strOpcion='CI') THEN
		Select EMPLEADOS.EMP_FechaIngreso,EMPLEADOS.PAQ_Id,EMPLEADOS.EMP_Activo,EMPLEADOS.EMP_Id,EMPLEADOS.EMP_FechaEntrega,EMPLEADOS.CAT_TallaCamisa,EMPLEADOS.CAT_TallaPant,EMPLEADOS.CAT_TallaSudadera,EMPLEADOS.EST_Id FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_FirmaGafete = intFirmaGafete or EMPLEADOS.EMP_Id=intIdEmpleado
        Into dteFechaIngreso,intIdPaquete,blnActivo,intIdEmpleado,dteFechaEntrega,intIdTallaCamisa,intIdTallaPantalon,intIdTallaSudadera,intEstatus;
		
        IF (SELECT count(*) FROM dai_empleados EMPLEADOS WHERE EMPLEADOS.EMP_Id = intIdEmpleado )=0 THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡No existe el empleado!';
		END IF;
        IF  year(dteFechaIngreso)=YEAR(now())  THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡No se puede realizar la entrega por la fecha de ingreso!';
		END IF;
         IF  blnActivo=0 THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡Empleado no activo!';
		END IF;
       /*  IF  dteFechaEntrega>cast(now() as date) THEN
			SIGNAL SQLSTATE VALUE '99999'
			SET MESSAGE_TEXT = '¡Numero de entrega no es valida segun la fecha!';
		END IF;*/
		SELECT 		EMPLEADOS.EMP_Id as Id,
					EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
                    EMPLEADOS.EMP_FirmaGafete as FIRMA_GAFETE,
                    EMPLEADOS.EMP_Nombre	as NOMBRE_EMPLEADO,
                    ifnull(PAQUETE.PAQ_NOMBRE,'') AS NOMBRE_PAQUETE,
                    AREA.CAT_NOMBRE			AS AREA,
                    PUESTO.CAT_NOMBRE 		AS PUESTO,
                    DATE_FORMAT(EMPLEADOS.EMP_FechaIngreso,"%d %M %Y") as FECHA_INGRESO,
                    EMPLEADOS.PAQ_Id as PAQ_Id,
                    ifnull(PAQUETE.PAQ_NOMBRE,'') AS PAQUETE,
                    EMPLEADOS.CAT_TallaCamisa as CAT_TALLA_CAMISA,
                    EMPLEADOS.CAT_TallaPant as CAT_TALLA_PANTALON,
                    TALLA_CAMISA.CAT_Clave as TALLA_CAMISA,
                    TALLA_PANTALON.CAT_Clave as TALLA_PANTALON,
					EMPLEADOS.EMP_ComentariosUltimaEntrega as COMENTARIOS_ENTREGA,
                    IfNull(EMPLEADOS.EMP_ComentariosTomaTalla,'') AS COMENTARIOS_TOMA_TALLA,
                    ESTATUS.EST_Nombre as ESTATUS,
                    IfNull(DATE_FORMAT(EMPLEADOS.EMP_FechaUltimaEntrega,"%d %M %Y %h:%m"),'') as FECHA_ULTIMA_ENTREGA
		FROM 		dai_empleados EMPLEADOS 
				
					Join dai_catalogos AREA
						on AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						on PUESTO.CAT_Id=EMPLEADOS.CAT_PUESTO   
					Join dai_estatus ESTATUS 
						on ESTATUS.EST_Id=EMPLEADOS.EST_Id
					Left Join dai_paquetes_entrega PAQUETE
						on EMPLEADOS.PAQ_Id=PAQUETE.PAQ_Id
					Left Join dai_catalogos TALLA_CAMISA
						on TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
					Left Join dai_catalogos TALLA_PANTALON
						on TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
		WHERE		EMPLEADOS.EMP_Id=intIdEmpleado;
        
        Select	    PAQUETE.PAQ_Id as Id,
					PAQUETE.PAQ_Nombre as NOMBRE
        From		dai_paquetes_entrega PAQUETE
        Where		PAQUETE.PAQ_Activo=1
        Order		by NOMBRE;
		

        
		Select 	CATALOGO.CAT_Id as Id,
				CATALOGO.CAT_CLAVE AS NOMBRE
		From 	dai_catalogos_tipo CATALOGO_TIPO
				Join dai_catalogos CATALOGO
					on CATALOGO.CTT_Id=CATALOGO_TIPO.CTT_Id
				Join dai_catalogos_extras CATALOGO_EXTRA
					on CATALOGO_EXTRA.CAT_Id=CATALOGO.CAT_Id and CATALOGO_EXTRA.CAX_Tipo='Division' and CATALOGO_EXTRA.CAX_Valor='Top'
		Where	CATALOGO_TIPO.CTT_Clave='TALL'
		order by CATALOGO.CAT_Orden;
		
        Select 	CATALOGO.CAT_Id as Id,
				CATALOGO.CAT_CLAVE AS NOMBRE
		From 	dai_catalogos_tipo CATALOGO_TIPO
				Join dai_catalogos CATALOGO
					on CATALOGO.CTT_Id=CATALOGO_TIPO.CTT_Id
				Join dai_catalogos_extras CATALOGO_EXTRA
					on CATALOGO_EXTRA.CAT_Id=CATALOGO.CAT_Id and CATALOGO_EXTRA.CAX_Tipo='Division' and CATALOGO_EXTRA.CAX_Valor='Pant'
		Where	CATALOGO_TIPO.CTT_Clave='TALL'
		order by CATALOGO.CAT_Orden;	
        
		Select	PRENDAS.PRE_Id as Id,
				PRENDAS.PRE_NOMBRE AS NOMBRE,
                PRENDAS.PRE_DIVISION AS DIVISION
        From 	dai_prendas PRENDAS
        Where	PRENDAS.PRE_Activo=1;
        if intEstatus<>3 THEN
		/*	IF (intIdTallaSudadera  )>0 THEN
            	Select	PRENDAS.PRE_Id as Id,
						PRENDAS.PRE_NOMBRE AS NOMBRE,
						PRENDAS.PRE_CATEGORIA  AS CATEGORIA,
						PAQUETE_DETALLE.PAD_CANTIDAD AS CANTIDAD,
						PAQUETE_DETALLE.PAD_CANTIDAD - ifnull(ENTREGA.CANTIDAD,0) AS CANTIDAD_ENTREGA,
						EXISTENCIAS.EXI_CANTIDAD AS EXISTENCIA,
						intIdTallaSudadera as CAT_TALLA,
						TALLA.CAT_Clave as TALLA
				From	dai_paquetes_entrega_detalle PAQUETE_DETALLE
						Join dai_prendas PRENDAS
