-- Volcando estructura para procedimiento daimler.PA_DAIConReportesEntrega
DELIMITER //
CREATE PROCEDURE `PA_DAIConReportesEntrega`(IN jsonParametros JSON)
BEGIN

	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
    DECLARE 	intHC 		BIGINT;
     DECLARE 	intRegistrados 	BIGINT;
     DECLARE	intRegistradosDia bigint;
     DECLARE	intPorcentaje	bigint;
     DECLARE	intEntrega INT;
     DECLARE 	intHora int;
     DECLARE 	dteFechaInicio datetime;
     DECLARE	dateFechaFin datetime;
     
    Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
   			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario'))
	INTO  strOpcion,strUsuario;
	/*Resumen de refacturada*/
	If (strOpcion='CRF') THEN
		Select 	NUMERO_ENTREGA.CAL_NombreEntrega AS ENTREGA,
				PRENDA.PRE_TIPO AS PRENDA,
				SUM(DETALLE.MOD_CANTIDAD) AS CANTIDAD,
                PRENDA.PRE_PRECIO AS PRECIO,
                SUM(DETALLE.MOD_CANTIDAD)*  PRENDA.PRE_PRECIO AS IMPORTE
        From  	dai_movimientos MOVIMIENTOs
				Join dai_movimientos_detalle DETALLE
					on MOVIMIENTOS.MOV_Id=DETALLE.MOV_Id
				Join dai_prendas PRENDA
					on PRENDA.PRE_Id=DETALLE.PRE_Id
				Join dai_entregas_calendario NUMERO_ENTREGA
					on NUMERO_ENTREGA.CAL_FECHA=MOVIMIENTOS.MOV_FECHA
        Where	MOVIMIENTOS.CAT_Tipo in (55)
        GROUP	BY 	NUMERO_ENTREGA.CAL_NombreEntrega ,
					PRENDA.PRE_TIPO,
					PRENDA.PRE_PRECIO;
    END IF;
    /*Resumen General*/
	If (strOpcion='C') THEN
			Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
					Where	EMPLEADOS.EMP_Activo=1 
			Into intHC;
            
            Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1 and EMPLEADOS.EST_Id<>1 
            Into	intRegistrados;
			
			Select  HOUR(now()) hour
			Into	intHora;
            
            IF   intHora <8 THEN
					Set @dteFechaInicio=cast(DATE_ADD( now(), INTERVAL -1 DAY) as date);
					Set @dteFechaInicio=DATE_ADD( @dteFechaInicio, INTERVAL 8 HOUR);
            ELSE
					Set @dteFechaInicio=cast( now() as date);
					Set @dteFechaInicio=DATE_ADD( @dteFechaInicio, INTERVAL 8 HOUR);
            
            END IF;
            
			Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1 and EMPLEADOS.EST_Id<>1 
            and EMPLEADOS.EMP_FechaUltimaEntrega between  @dteFechaInicio and  now() 
            Into	intRegistradosDia;
            
			select (intRegistrados*100) / intHC
            Into intPorcentaje;
            
            Select intHC as HC, intRegistrados AS REGISTRADOS,intRegistradosDia as REGISTRADOS_DIA, intPorcentaje AS PORCENTAJE;
            
      END IF;
      /*Resumen General */
    If (strOpcion='CR') THEN
		CREATE TEMPORARY TABLE IF NOT EXISTS dttEntrega
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
            ClaveArea varchar(30) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		CREATE TEMPORARY TABLE IF NOT EXISTS dttHC
		 (
            NumEntrega int, 
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			ClaveArea varchar(30) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		Select 	
			    
                count(EMPLEADOS.EMP_Id)  as HC,
				AREA.CAT_Nombre as AREA,
                AREA.CAT_Clave as CLAVE_AREA,
                PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto		
		Where	EMPLEADOS.EMP_Activo=1 And EMPLEADOS.EST_Id<>1 
        and  PUESTO.CAT_Clave NOT IN ('TL','BGD','CSH') 
        /*and AREA.CAT_CLAVE IN ('CIW','PCH','OFFLINE','BEFORE','FCH','FCB','PINTURA','MRG','HR','CTS','MATERIALES','CALIDAD','TOS')*/
		 group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre,  AREA.CAT_Clave;

        
		Select 	
                EMPLEADOS.EMP_NumeroEntrega AS NumEntrega,
				count(EMPLEADOS.EMP_Id) ,
				AREA.CAT_Nombre as AREA,
                 AREA.CAT_Clave as CLAVE_AREA,
                PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
		Where	EMPLEADOS.EMP_Activo = 1
			and PUESTO.CAT_Clave = 'NE'
        /*and  PUESTO.CAT_Clave NOT IN ('TL','BGD','CSH') **/
        /*and AREA.CAT_CLAVE IN ('CIW','PCH','OFFLINE','BEFORE','FCH','FCB','PINTURA','MRG','HR','CTS','MATERIALES','CALIDAD','TOS')*/
		group 	by EMPLEADOS.EMP_NumeroEntrega, AREA.CAT_Nombre,PUESTO.CAT_Nombre,  AREA.CAT_Clave;

        Select  HC.AREA,HC.PUESTO, HC.CANTIDAD AS HC, 
                IfNull(Entrega.CANTIDAD,0) AS REGISTRADOS ,
                HC.CANTIDAD  -IfNull(Entrega.CANTIDAD,0)  as FALTANTES, 
                (IfNull(Entrega.CANTIDAD,0)*100 )/HC.CANTIDAD as PORCENTAJE,
                HC.NumEntrega AS NUMERO_ENTREGA
		From 	dttHC HC 
				Join dai_catalogos AREA
					on AREA.CAT_Clave=HC.ClaveArea
				Left Join dttEntrega Entrega 
					on HC.ClaveArea=Entrega.ClaveArea And HC.Puesto=Entrega.Puesto
         Order by AREA.CAT_Orden   asc    ;
		drop table dttEntrega;
		drop table dttHC;    
    END IF;
    
    
    
    /*Resumen Especialidades*/
     If (strOpcion='CRE') THEN
		CREATE TEMPORARY TABLE IF NOT EXISTS dttEntrega
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		CREATE TEMPORARY TABLE IF NOT EXISTS dttHC
		 (
			NumEntrega Int, 
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		Select 	count(EMPLEADOS.EMP_Id)  as HC,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto		
		Where	EMPLEADOS.EMP_Activo=1 And EMPLEADOS.EST_Id<>1 and  PUESTO.CAT_Clave  IN ('TL','BGD','CSH') 
                /*and  PUESTO.CAT_Clave  IN ('TL','BGD','CSH') */
		 group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;

        
		Select 	EMPLEADOS.EMP_NumeroEntrega AS NumEntrega,
                 count(EMPLEADOS.EMP_Id) ,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
		Where	EMPLEADOS.EMP_Activo=1  and  PUESTO.CAT_Clave IN ('TL','BGD','CSH', 'BGD_CSH', 'BGD_TL', 'CSH_TL') 
        /*and  PUESTO.CAT_Clave  IN ('TL','BGD','CSH') */
		group 	by EMPLEADOS.EMP_NumeroEntrega, AREA.CAT_Nombre,PUESTO.CAT_Nombre;

        Select  HC.NumEntrega AS NUMERO_ENTREGA, HC.AREA,HC.PUESTO,HC.CANTIDAD AS HC, IfNull(Entrega.CANTIDAD,0) AS REGISTRADOS ,HC.CANTIDAD  -IfNull(Entrega.CANTIDAD,0)  as FALTANTES, (IfNull(Entrega.CANTIDAD,0)*100 )/HC.CANTIDAD as PORCENTAJE
		From 	dttHC HC 
				Left Join dttEntrega Entrega 
					on HC.Area=Entrega.Area And HC.Puesto=Entrega.Puesto;
                
		drop table dttEntrega;
		drop table dttHC;    
    END IF;
    /*Consulta de faltantes*/
	If (strOpcion='CEF') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.Emp_NumeroEntrega As NUMERO_ENTREGA,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
                EMPLEADOS.CAT_Turno as TURNO,
               /* EMPLEADOS.CAT_Turno as TURNO,
                TALLA_SUDADERA.CAT_Clave as TURNO,*/
				/*CASE WHEN EMPLEADOS.EMP_Activo=1 THEN 'Activo' ELSE 'Baja' END AS TURNO,
           ifnull(TALLA_ENTREGADA.TALLA, TALLA_SUDADERA.CAT_Clave) as TURNO,*/
				PUESTO.CAT_Nombre AS PUESTO
            
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				/*Left Join (
					Select 	distinct MOVIMIENTO.EMP_Id,
							MAX(TALLA.CAT_Clave) as TALLA
					From 	dai_movimientos MOVIMIENTO
							Join dai_movimientos_detalle DETALLE
								on MOVIMIENTO.MOV_Id=DETALLE.MOV_Id
							Join dai_prendas PRENDA
								on PRENDA.PRE_Id=DETALLE.PRE_Id
							Join dai_catalogos TALLA
								on TALLA.CAT_Id=DETALLE.CAT_Talla
					Where PRENDA.PRE_Tipo IN ('SUDADERA') AND MOVIMIENTO.CAT_Tipo=55
					Group by MOVIMIENTO.EMP_Id
						) AS TALLA_ENTREGADA 
							on TALLA_ENTREGADA.EMP_Id=EMPLEADOS.EMP_Id*/
				Left Join dai_catalogos TALLA_CAMISA	
					on TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
				Left Join dai_catalogos TALLA_PANTALON	
					on TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
				Left Join dai_catalogos TALLA_SUDADERA	
					on TALLA_SUDADERA.CAT_Id=EMPLEADOS.CAT_TallaSudadera
		Where	EMPLEADOS.EST_Id=1 And EMPLEADOS.EMP_Activo=1;
        /*Group By EMPLEADOS.EMP_NumeroEntrega;*/
        /*and AREA.CAT_CLAVE IN ('CIW','PCH','OFFLINE','BEFORE','FCH','FCB','PINTURA','MRG','MATERIALES','TOS')  AND PUESTO.CAT_Clave Not In  ('TL','BGD','CSH')
        Union 	all
        SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO
            
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
		Where	EMPLEADOS.EST_Id=1 and EMPLEADOS.EMP_Activo=1 aND PUESTO.CAT_Clave =  'TL'  ;*/
		
    END IF;
    /*Consulta de registrados*/
	If (strOpcion='CER') THEN
        Select 	ENTREGA.CAL_NumeroEntrega
        From	dai_entregas_calendario ENTREGA
        Where	ENTREGA.CAL_FECHA=CAST(now() as DATE)
        Into	intEntrega;
        
        CREATE TEMPORARY TABLE IF NOT EXISTS dttEntrega
		 (
			idEmpleado 		bigint,
            idMovimiento 	bigint,
            Tipo			varchar(15),
			Cantidad 		bigint DEFAULT NULL
		);
        Select  MOVIMIENTOS.EMP_Id,
				MOVIMIENTOS.MOV_Id,
				PRENDA.PRE_TIpo,
                Sum(DETALLE.MOD_CANTIDAD)
        From	dai_movimientos MOVIMIENTOS
				JOin dai_movimientos_detalle DETALLE
					on MOVIMIENTOS.MOV_Id=DETALLE.MOV_Id 
				Join dai_prendas PRENDA
					on PRENDA.PRE_Id=DETALLE.PRE_Id
				Join dai_entregas_calendario ENTREGA
					ON ENTREGA.CAL_FECHA=MOVIMIENTOS.MOV_FECHA AND ENTREGA.CAL_NumeroEntrega=intEntrega
	Where		MOVIMIENTOS.CAT_Tipo=55
		group 	by MOVIMIENTOS.EMP_Id,
				PRENDA.PRE_TIpo,	
                MOVIMIENTOS.MOV_Id;

		SELECT 	MOVIMIENTOS.MOV_FechaHora as FECHA,
				MOVIMIENTOS.MOV_Id as FOLIO,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				PUESTO.CAT_NOMBRE AS PUESTO,
                MOVIMIENTOS.MOV_DOCUMENTO AS COMENTARIOS,
                ifnull(CAMISA.Cantidad,0) AS CAMISA,
				ifnull(PANTALON_MEZC.Cantidad,0) AS PANTALON_MEZC,
                ifnull(PANT_GAB.Cantidad,0) as PANT_GAB,
				ifnull(PLAYERA.Cantidad,0) as PLAYERA,
				ifnull(CAMISA_BGD.Cantidad,0) as CAMISA_BGD,
				ifnull(PANT_BGD.Cantidad,0) as PANT_BGD,
               	ifnull(SUDADERA.Cantidad,0) as SUDADERA,
				sum(ifnull(ENTREGA_TOTAL.CANTIDAD,0)) as TOTAL
		FROM 	dai_movimientos MOVIMIENTOS
				Join DAI_EMPLEADOS EMPLEADOS
					on EMPLEADOS.EMP_Id=MOVIMIENTOS.EMP_Id
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				Join dai_entregas_calendario ENTREGA
					ON ENTREGA.CAL_FECHA=MOVIMIENTOS.MOV_FECHA AND ENTREGA.CAL_NumeroEntrega=intEntrega
				Left Join dttEntrega CAMISA 
					on CAMISA.idEmpleado=EMPLEADOS.EMP_Id And Camisa.Tipo='CAMISA' and CAMISA.idMovimiento=MOVIMIENTOS.MOV_Id
                Left Join dttEntrega PANTALON_MEZC 
					on PANTALON_MEZC.idEmpleado=EMPLEADOS.EMP_Id And PANTALON_MEZC.Tipo='PANT_MEZC' and PANTALON_MEZC.idMovimiento=MOVIMIENTOS.MOV_Id
                Left Join dttEntrega PANT_GAB 
					on PANT_GAB.idEmpleado=EMPLEADOS.EMP_Id And PANT_GAB.Tipo='PANT_GAB' and PANT_GAB.idMovimiento=MOVIMIENTOS.MOV_Id
                 Left Join dttEntrega PLAYERA 
					on PLAYERA.idEmpleado=EMPLEADOS.EMP_Id And PLAYERA.Tipo='PLAYERA' and PLAYERA.idMovimiento=MOVIMIENTOS.MOV_Id
                 Left Join dttEntrega CAMISA_BGD 
					on CAMISA_BGD.idEmpleado=EMPLEADOS.EMP_Id And CAMISA_BGD.Tipo='CAMISA_BGD'      and CAMISA_BGD.idMovimiento=MOVIMIENTOS.MOV_Id
				Left Join dttEntrega PANT_BGD 
					on PANT_BGD.idEmpleado=EMPLEADOS.EMP_Id And PANT_BGD.Tipo='PANT_BGD' AND PANT_BGD.idMovimiento=MOVIMIENTOS.MOV_Id
				Left Join dttEntrega SUDADERA 
					on SUDADERA.idEmpleado=EMPLEADOS.EMP_Id And SUDADERA.Tipo='SUDADERA' AND SUDADERA.idMovimiento=MOVIMIENTOS.MOV_Id
                 Left Join dttEntrega ENTREGA_TOTAL  
					on ENTREGA_TOTAL.idEmpleado=EMPLEADOS.EMP_Id     aND ENTREGA_TOTAL.idMovimiento=MOVIMIENTOS.MOV_Id  
		Where	EMPLEADOS.EST_Id<>1 and MOVIMIENTOS.CAT_Tipo=55
		GROUP	BY MOVIMIENTOS.MOV_Fecha ,
				MOVIMIENTOS.MOV_Id ,
				EMPLEADOS.EMP_NumeroEmpleado ,
				EMPLEADOS.EMP_Nombre ,
				AREA.CAT_Nombre ,
				PUESTO.CAT_NOMBRE ,
                  MOVIMIENTOS.MOV_DOCUMENTO ,
                ifnull(CAMISA.Cantidad,0) ,
				ifnull(PANTALON_MEZC.Cantidad,0) ,
                ifnull(PANT_GAB.Cantidad,0) ,
				ifnull(PLAYERA.Cantidad,0) ,
				ifnull(CAMISA_BGD.Cantidad,0) ,
				ifnull(PANT_BGD.Cantidad,0)
               ;
    
    END IF;
    
    



    



	
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAIConReportesTomaTallas
DELIMITER //
CREATE PROCEDURE `PA_DAIConReportesTomaTallas`(IN jsonParametros JSON)
BEGIN

	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
    DECLARE 	intHC 		BIGINT;
     DECLARE 	intRegistrados 	BIGINT;
          DECLARE	intRegistradosDia bigint;
     DECLARE	intPorcentaje	bigint;
          DECLARE 	intHora int;
    Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
   			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario'))
	INTO  strOpcion,strUsuario;
      If (strOpcion='CRD') THEN
			Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1  AND ( AREA.CAT_Clave In ('MRG','SPARK','TOS','FAC','CTS')   AND PUESTO.CAT_Clave <> ('TL') )
			Into intHC;
            
            
            Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1 and Ifnull(EMPLEADOS.CAT_TallaCamisa,0)>0 
            Into	intRegistrados;
            
            Select  HOUR(now()) hour
			Into	intHora;
            
            IF   intHora <8 THEN
					Set @dteFechaInicio=cast(DATE_ADD( now(), INTERVAL -1 DAY) as date);
					Set @dteFechaInicio=DATE_ADD( @dteFechaInicio, INTERVAL 8 HOUR);
            ELSE
					Set @dteFechaInicio=cast( now() as date);
					Set @dteFechaInicio=DATE_ADD( @dteFechaInicio, INTERVAL 8 HOUR);
            
            END IF;
            Select 	count(*)
            From	dai_empleados EMPLEADOS
					Join dai_catalogos AREA
						ON AREA.CAT_Id=EMPLEADOS.CAT_Area
					Join dai_catalogos PUESTO
						ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
			Where	EMPLEADOS.EMP_Activo=1 and EMPLEADOS.EST_Id<>1 
            and EMPLEADOS.EMP_FechaTomaTalla between  @dteFechaInicio and  now() 
            Into	intRegistradosDia;
            
			select (intRegistrados*100) / intHC
            Into intPorcentaje;
            
            Select intHC as HC, intRegistrados AS REGISTRADOS,intRegistradosDia as REGISTRADOS_DIA, intPorcentaje AS PORCENTAJE;

      END IF;
    If (strOpcion='CR') THEN
		CREATE TEMPORARY TABLE IF NOT EXISTS dttTallaTomada 
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		CREATE TEMPORARY TABLE IF NOT EXISTS dttHC
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		Select 	count(EMPLEADOS.EMP_Id)  as HC,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto		
		Where	EMPLEADOS.EMP_Activo=1 And EMPLEADOS.CAT_TallaCamisa>0 
		 group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;
        
		Select 	count(EMPLEADOS.EMP_Id) ,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
		Where	EMPLEADOS.EMP_Activo=1   AND ( AREA.CAT_Clave In ('MRG','SPARK','TOS','FAC','CTS')   AND PUESTO.CAT_Clave <> ('TL') )
		   group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;
     
		
        Select  distinct HC.AREA,HC.PUESTO,HC.CANTIDAD AS HC, IfNull(TallaTomada.CANTIDAD,0) AS REGISTRADOS ,HC.CANTIDAD  -IfNull(TallaTomada.CANTIDAD,0)  as FALTANTES, (IfNull(TallaTomada.CANTIDAD,0)*100 )/HC.CANTIDAD as PORCENTAJE
		From 	dttHC HC 
			Left Join dttTallaTomada TallaTomada 
				on HC.Area=TallaTomada.Area And HC.Puesto=TallaTomada.Puesto;

        
		drop table dttTallaTomada;
		drop table dttHC;    
    END IF;
	If (strOpcion='CEF') THEN
		SELECT 	
				EMPLEADOS.EMP_Id as Id,
                EMPLEADOS.EMP_NumeroEntrega AS NUMERO_ENTREGA,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO
            
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
		Where	ifnull(EMPLEADOS.CAT_TallaCamisa,0) = 0
				AND EMPLEADOS.EMP_Activo = 1 
                AND ( AREA.CAT_Clave In ('MRG','SPARK','TOS','FAC','CTS')   
                AND PUESTO.CAT_Clave <> ('TL') ) ;
		
    END IF;
    	If (strOpcion='CER') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO,
				IFNULL(TALLA_CAMISA.CAT_CLAVE,'') AS CAMISA,
				IFNULL(TALLA_PANTALON.CAT_Nombre,'')AS PANTALON,
                IFNULL(TALLA_SUDADERA.CAT_CLAVE,'')AS SUDADERA,
                EMPLEADOS.EMP_ComentariosTomaTalla AS COMENTARIOS
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
				Left JoIN dai_catalogos TALLA_CAMISA
					on TALLA_CAMISA.CAT_Id=EMPLEADOS.CAT_TallaCamisa
				Left JoIN dai_catalogos TALLA_PANTALON
					on TALLA_PANTALON.CAT_Id=EMPLEADOS.CAT_TallaPant
				Left JoIN dai_catalogos TALLA_SUDADERA
					on TALLA_SUDADERA.CAT_Id=EMPLEADOS.CAT_TallaSudadera  
		Where	EMPLEADOS.CAT_TallaCamisa>0 
      order by AREA ASC;
    END IF;
    
    



    



	
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAIConResumenTomaTallas
DELIMITER //
CREATE PROCEDURE `PA_DAIConResumenTomaTallas`(IN jsonParametros JSON)
BEGIN

	DECLARE 	strOpcion varchar(10) ;
	DECLARE 	strUsuario VARCHAR(30);
    Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
   			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario'))
	INTO  strOpcion,strUsuario;
    
    If (strOpcion='CR') THEN
		CREATE TEMPORARY TABLE IF NOT EXISTS dttTallaTomada 
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		CREATE TEMPORARY TABLE IF NOT EXISTS dttHC
		 (
			Cantidad int,
			Area varchar(50) DEFAULT NULL,
			Puesto varchar(50) DEFAULT NULL
		);
		Select 	count(EMPLEADOS.EMP_Id)  as HC,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto		
		Where	EMPLEADOS.EMP_Activo=1 And EMPLEADOS.CAT_TallaCamisa>0
		group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;

		Select 	count(EMPLEADOS.EMP_Id) ,AREA.CAT_Nombre as AREA,PUESTO.CAT_Nombre as PUESTO
		from 	dai_empleados EMPLEADOS
				Join dai_catalogos AREA
					ON AREA.CAT_Id=EMPLEADOS.CAT_Area
				Join dai_catalogos PUESTO
					ON PUESTO.CAT_Id=EMPLEADOS.CAT_Puesto	
		Where	EMPLEADOS.EMP_Activo=1 
		group 	by AREA.CAT_Nombre,PUESTO.CAT_Nombre;
		
        Select  HC.AREA,HC.PUESTO,HC.CANTIDAD AS HC, IfNull(TallaTomada.CANTIDAD,0) AS REGISTRADOS ,HC.CANTIDAD  -IfNull(TallaTomada.CANTIDAD,0)  as FALTANTES, (IfNull(TallaTomada.CANTIDAD,0)*100 )/HC.CANTIDAD as PORCENTAJE
		From 	dttHC HC 
			Left Join dttTallaTomada TallaTomada 
				on HC.Area=TallaTomada.Area And HC.Puesto=TallaTomada.Puesto;

        
		drop table dttTallaTomada;
		drop table dttHC;    
    END IF;
	If (strOpcion='CEF') THEN
		SELECT 	EMPLEADOS.EMP_Id as Id,
				EMPLEADOS.EMP_NumeroEmpleado as NUMERO_EMPLEADO,
				EMPLEADOS.EMP_Nombre as NOMBRE,
				AREA.CAT_Nombre as AREA,
				TURNO.CAT_NOMBRE AS TURNO,
				PUESTO.CAT_NOMBRE AS PUESTO
            
		FROM 	DAI_EMPLEADOS EMPLEADOS
				Join DAI_CATALOGOS AREA
					ON EMPLEADOS.CAT_Area=AREA.CAT_Id
				Join DAI_CATALOGOS TURNO 
					ON EMPLEADOS.CAT_Turno=TURNO.CAT_Id
				Join DAI_CATALOGOS PUESTO
					ON EMPLEADOS.CAT_Puesto=PUESTO.CAT_Id
		Where	EMPLEADOS.CAT_TallaCamisa=0;
    END IF;
    
    



    



	
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAI_CapCatalogos
DELIMITER //
CREATE PROCEDURE `PA_DAI_CapCatalogos`(IN jsonParametros JSON)
sp:BEGIN
	DECLARE 	strOpcion 		 varchar(10) ;
	DECLARE 	strUsuario 		 VARCHAR(30);
	DECLARE 	strCodigo 		 varchar(10) ;
	DECLARE		strDetalle 		 varchar(255);	
	DECLARE		intEstatus 		 INT ;
	DECLARE		intId			 BIGINT;
    DECLARE		intIdTipo		 BIGINT;
    DECLARE		blnActivo		 bit;
    DECLARE		strClaveCatalogo varchar(10);
    DECLARE     strToken         Text;
    DECLARE     strTokenUser     Text;
    DECLARE		strAccion        varchar(30);
    DECLARE		strModulo        varchar(30) default 'jm_core';
    DECLARE		strPrograma      varchar(50)  default 'core_catalogos';
	DECLARE		jsonAnterior 	 JSON;
    DECLARE     strMotivo        varchar(100);
    
	DECLARE CONTINUE HANDLER FOR SQLEXCEPTION 
		BEGIN
			SET intEstatus = 0;
			GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle = MESSAGE_TEXT;
		END;
	SET  lc_time_names = 'es_ES';
    
   select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
			JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.ClaveCatalogo')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Catalogo.Id'))
	INTO  strOpcion,strUsuario,strClaveCatalogo,intId;
    
    /* Consulta prendas */
    If(strOpcion = 'CP') Then 
		Select PRE_Id     As Id ,
			   PRE_Nombre As NOMBRE
		From dai_prendas 
        Where PRE_Activo = 1;
    End If; 
    
	IF (strOpcion='CC') THEN
		Select 	CATALOGO.CAT_Id as Id,
				CATALOGO.CAT_Clave as CLAVE,
                CATALOGO.CAT_Nombre as NOMBRE
        From	dai_catalogos_tipo TIPO
				Left Join dai_catalogos CATALOGO
					on TIPO.CTT_Id = CATALOGO.CTT_Id
		Where	CATALOGO.CAT_Activo = 1 And TIPO.CTT_Clave = strClaveCatalogo
        order by Nombre;
                    
	END IF;
    
    IF (strOpcion In ('C','CT')) THEN
		Select 	TIPO.CTT_Id as Id,
				TIPO.CTT_Clave as CLAVE,
                TIPO.CTT_Nombre as NOMBRE,
                TIPO.CTT_Descripcion as DESCRIPCION,
                TIPO.CTT_Usuario as USUARIO,
                TIPO.CTT_Fecha as FECHA
        From	core_catalogos_tipo TIPO
        Order 	By Nombre;
	END IF;
     IF (strOpcion = 'CI') THEN
		Select 
             CATALOGOS.CAT_Id                       As Id,
			 CATALOGOS.CTT_Id                       As IdTipo,
			 CATALOGOS.CAT_Clave  					As CLAVE,
             CATALOGOS.CAT_Nombre 					As NOMBRE,
             CATALOGOS.CAT_Descripcion 				As DESCRIPCION,
             CATALOGOS.CAT_Usuario 					As USUARIO,
             CATALOGOS.CAT_Fecha 					As FECHA,
             CATALOGOS.CAT_UsuarioModifica   		As USUARIO_MODIFICA,
             CATALOGOS.CAT_FechaModifica     		As FECHA_MODIFICA,
             CATALOGOS.CAT_UsuarioElimina			As USUARIO_ELIMINA,
             CATALOGOS.CAT_FechaElimina				As FECHA_ELIMINA,
             CATALOGOS.CAT_MotivoEliminacion		As MOTIVO,
             CAST(CATALOGOS.CAT_Activo AS unsigned) As ACTIVO
        From core_catalogos CATALOGOS
			Join core_catalogos_tipo CATALOGOS_TIPO
				On CATALOGOS_TIPO.CTT_Id = CATALOGOS.CTT_Id
		Where CATALOGOS.CTT_Id = intId;
	END IF;
    IF (strOpcion='G') THEN
		select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Catalogo.Clave')),
				JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Catalogo.IdTipo'))
		INTO  strClaveCatalogo, intIdTipo;
		IF intId = 0 THEN
			IF (SELECT count(*) 
				FROM core_catalogos CATALOGO 
                WHERE CATALOGO.CAT_Clave = strClaveCatalogo 
                And CATALOGO.CTT_Id=intIdTipo ) > 0 THEN
				SIGNAL SQLSTATE VALUE '99999'
				SET MESSAGE_TEXT = '¡Catalogo Existente!';
			END IF;	
        END IF;        
		START TRANSACTION;
		IF intId = 0 THEN  
			SET strAccion='crear';
				CAT_Clave,
				CAT_Nombre,
                CTT_Id,
				CAT_Descripcion,
				CAT_Fecha,
				CAT_Usuario,
				CAT_Activo
			)
			SELECT DISTINCT 
					Catalogo.Clave       as CAT_Clave,
					Catalogo.Nombre      as CAT_Nombre,
                    Catalogo.CLAVE_TIPO  as CTT_Id,
					Catalogo.Descripcion as CAT_Descripcion,
					now() 				 as CAT_Fecha,
					strUsuario 			 as CAT_Usuario,
                    1 					 as PER_Activo
			FROM JSON_TABLE(jsonParametros, '$.Catalogo'
					COLUMNS (
						CLAVE       varchar(15)  PATH '$.CLAVE', 
						NOMBRE      VARCHAR(50)  PATH '$.NOMBRE',
						CLAVE_TIPO  bigint       PATH '$.CLAVE_TIPO',
						DESCRIPCION	varchar(150) PATH '$.DESCRIPCION'
					)
				) AS Catalogo;
            Set intId = LAST_INSERT_ID();	
		ELSE
				SET strAccion = 'actualizar';
				Update core_catalogos CATALOGO
				Join ( select 
						Id,
						CLAVE,
						NOMBRE,
                        IdTipo,
						DESCRIPCION,
						ACTIVO
				FROM JSON_TABLE(jsonParametros, '$.Catalogo'
					COLUMNS (
						Id		     bigint	     PATH '$.Id',
						CLAVE        VARCHAR(15)  PATH '$.CLAVE',
						NOMBRE       VARCHAR(50)  PATH '$.NOMBRE',
						IdTipo       Bigint       PATH '$.IdTipo',
						DESCRIPCION  VARCHAR(150) PATH '$.DESCRIPCION',
						ACTIVO       bit          PATH '$.ACTIVO'
					)
				) AS CATALOGO_UP )  AS CATALOGO_UP 
					  on CATALOGO.CAT_Id = CATALOGO_UP.Id
				SET CATALOGO.CAT_Clave             = CATALOGO_UP.CLAVE,
					CATALOGO.CAT_Nombre            = CATALOGO_UP.NOMBRE,
                    CATALOGO.CTT_Id                = CATALOGO_UP.IdTipo,
                    CATALOGO.CAT_Descripcion       = CATALOGO_UP.DESCRIPCION,
                    CATALOGO.CAT_UsuarioModifica   = strUsuario, 
                    CATALOGO.CAT_FechaModifica     = now(),
                    CATALOGO.CAT_Activo            = CATALOGO_UP.ACTIVO,
                    CATALOGO.CAT_UsuarioElimina    = null,
					CATALOGO.CAT_FechaElimina      = null,
					CATALOGO.CAT_MotivoEliminacion = null;
        END IF;

		IF intEstatus = 0 then
				ROLLBACK;
				call PA_CORE_Bitacoras(strModulo, strPrograma, "ErrorSQL", intId, jsonParametros, json_object("Error", strDetalle), strUsuario);
            	SELECT  intId, intEstatus, strCodigo, strDetalle;
        ELSE 
			 call PA_CORE_Bitacoras(strModulo, strPrograma, strAccion, intId, jsonAnterior, jsonParametros, strUsuario);
             Select intId As Id;
        	COMMIT;
      END IF;
	END IF;
    
    /* Consulta catalogo permisos */
    If(strOpcion = 'CCP') Then 
		SELECT CAT_Id     As Id,
               CAT_Nombre As NOMBRE
        FROM core_catalogos
		Where CTT_Id = 2;
    End If; 
    
    /* Desactivar catalogos */
    If (strOpcion = 'DC') Then
		select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Catalogo.Motivo'))
		INTO  strMotivo;
        START TRANSACTION;
		Update core_catalogos CATALOGO
				Join ( Select Id, Motivo
				FROM JSON_TABLE(jsonParametros, 
					   '$.Catalogo[*]' COLUMNS (
						Id		bigint 		 PATH '$.Id',
                        Motivo  varchar(100) PATH '$.Motivo'
					)
				) AS CATALOGO_UP )  AS CATALOGO_UP 
					  on CATALOGO.CAT_Id = CATALOGO_UP.Id
				SET  CATALOGO.CAT_MotivoEliminacion = CATALOGO_UP.Motivo,
                     CATALOGO.CAT_Activo            = 0,
                     CATALOGO.CAT_UsuarioElimina    = strUsuario,
                     CATALOGO.CAT_FechaElimina      = now();
			IF intEstatus = 0 then
				ROLLBACK;
				call PA_CORE_Bitacoras(strModulo, strPrograma, "ErrorSQL", intId, jsonParametros, json_object("Error", strDetalle), strUsuario);
            	SELECT  intId, intEstatus, strCodigo, strDetalle;
			ELSE 
				 call PA_CORE_Bitacoras(strModulo, strPrograma, strAccion, intId, jsonAnterior, jsonParametros, strUsuario);
				 Select intId As Id;
				COMMIT;
		  END IF;
	  END IF;
END//
DELIMITER ;

-- Volcando estructura para procedimiento daimler.PA_DAI_CapEmbarque
DELIMITER //
CREATE PROCEDURE `PA_DAI_CapEmbarque`(IN jsonParametros JSON)
sp:BEGIN
    /*VARIABLES GLOBALES */
    DECLARE 	strOpcion varchar(10); 
    DECLARE 	strUsuario VARCHAR(30);
    DECLARE 	strCodigo varchar(10); 
    DECLARE		strDetalle varchar(255);	
    DECLARE		intEstatus 		BOOL DEFAULT 1;
    DECLARE     strToken       Text;
    DECLARE     strTokenUser   Text;
    DECLARE		strAccion varchar(30);
    DECLARE		strModulo varchar(30) default 'daimler';
    DECLARE		strPrograma varchar(50)  default 'dai_embarque';
    DECLARE		strTabla varchar(15) ; 
    DECLARE		jsonAnterior JSON;
    DECLARE		intId			BIGINT;
    DECLARE		blnActivo		bit;
    DECLARE     strMotivo       varchar(100);
    DECLARE CONTINUE HANDLER FOR SQLEXCEPTION 
        BEGIN
            SET intEstatus = 0;
            GET DIAGNOSTICS CONDITION 1 strCodigo = RETURNED_SQLSTATE, strDetalle = MESSAGE_TEXT;
        END;
    SET  lc_time_names = 'es_ES';
    /* SETEAR VALOR DEL NODO PRINCIPAL */
    Select JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Opcion')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Usuario')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Token')),
            JSON_UNQUOTE(JSON_EXTRACT( jsonParametros,'$.Embarque.Id'))
    INTO  strOpcion, strUsuario, strToken, intId;
    
    /* CONUSLTAS */
    If (strOpcion in ('C', 'CT')) Then 
        Select 
			MOVIMIENTOS.MOV_Id   As ID,
            MOV_Fecha            As FECHA,
            MOV_Usuario          As USUARIO,
            MOV_Documento        As COMENTARIOS,
            CATALOGO.CAT_Nombre  As TIPO_CATALOGO,
            MOVIMIENTOS.CAT_Tipo As ID_TIPO_CATALOGO
		From dai_movimientos MOVIMIENTOS
			Left Join dai_catalogos CATALOGO
				On MOVIMIENTOS.CAT_Tipo = CATALOGO.CAT_Id
		/*Where MOVIMIENTOS.CAT_Tipo = 54 OR MOVIMIENTOS.CAT_Tipo = 64*/
        Where MOVIMIENTOS.CAT_Tipo in(54,64,59,60)
			  AND 
              MOVIMIENTOS.MOV_Activo = 1;
    End If; 
    
    /* MOVIMIENTO DETALLE */
    If (strOpcion in ('CD', 'CDT')) Then 
        Select 
			MOVIMIENTOS_DETALLE.MOD_Id    As ID,
            MOVIMIENTOS_DETALLE.PRE_Id    As ID_PRENDA,
            PRENDAS.Pre_Nombre            As PRENDA,
            MOVIMIENTOS_DETALLE.CAT_Talla As ID_TALLA,
            TALLAS.CAT_Clave             As TALLA,
            MOD_Cantidad                  As CANTIDAD
		From dai_movimientos_detalle MOVIMIENTOS_DETALLE
			Left Join dai_prendas PRENDAS
				On PRENDAS.PRE_Id = MOVIMIENTOS_DETALLE.PRE_Id
			Left Join dai_catalogos TALLAS
				On MOVIMIENTOS_DETALLE.CAT_Talla = TALLAS.CAT_Id
		Where MOVIMIENTOS_DETALLE.MOV_Id = intId
			AND MOVIMIENTOS_DETALLE.MOD_Activo = 1;
    End If; 
    
    /* GUARDAR O EDITAR */
    IF (strOpcion='G') THEN
        START TRANSACTION;
        IF intId = 0 THEN
            SET strAccion = 'guardarEmbarque';
                MOV_Fecha,
                MOV_FechaHora,
                MOV_Documento,
                MOV_Usuario,
                MOV_Entrada,
                CAT_Tipo,
                MOV_Activo
            ) SELECT DISTINCT 
                EMBARQUE.Fecha          As MOV_Fecha,
                NOW()                   As MOV_FechaHora,
                EMBARQUE.Comentario     As MOV_Comentario,
                EMBARQUE.Usuario        As MOV_Usuario,
                1                       As MOV_Entrada,
                EMBARQUE.Tipo_Catalogo  As CAT_Tipo,
                1                       As MOV_Activo
            FROM JSON_TABLE (jsonParametros, '$.Embarque'
                COLUMNS (
						Fecha          datetime    PATH '$.Fecha',
                        Comentario     varchar(45) PATH '$.Comentario',
                        Usuario        varchar(45) PATH '$.Usuario',
                        Tipo_Catalogo  bigint      PATH '$.Tipo_Catalogo'
                    )
                ) AS EMBARQUE;
            set intId = LAST_INSERT_ID();
        ELSE
            SET strAccion='actualizarEmbarque';
            Select json_object ("MOV_Id", MOVIMIENTOS.MOV_Id,
								"MOV_Fecha", MOVIMIENTOS.MOV_Fecha,
								"MOV_FechaHora", MOVIMIENTOS.MOV_FechaHora,
								"MOV_Documento", MOVIMIENTOS.MOV_Documento,
								"CAT_Tipo", MOVIMIENTOS.CAT_Tipo,
								"MOV_Activo", MOVIMIENTOS.MOV_Activo
								)
			From dai_movimientos MOVIMIENTOS
			Where MOVIMIENTOS.MOV_Id = intId;
            
			Update dai_movimientos MOVIMIENTO
			Join ( select
				    Id,
					Fecha,
					Comentario,
					Usuario,
					Tipo_Catalogo
			FROM JSON_TABLE(jsonParametros, '$.Embarque'
				COLUMNS (
                    Id             bigint      PATH '$.Id',
					Fecha          datetime    PATH '$.Fecha',
					Comentario     varchar(45) PATH '$.Comentario',
					Usuario        varchar(45) PATH '$.Usuario',
					Tipo_Catalogo  bigint      PATH '$.Tipo_Catalogo'
				)
			) AS MOVIMIENTO_UP )  AS MOVIMIENTO_UP 
				  on MOVIMIENTO.MOV_Id = MOVIMIENTO_UP.Id
			SET MOVIMIENTO.MOV_Fecha     = MOVIMIENTO_UP.Fecha,
                MOVIMIENTO.MOV_FechaHora = NOW(),
                MOVIMIENTO.MOV_Documento = MOVIMIENTO_UP.Comentario,
                MOVIMIENTO.MOV_Usuario   = MOVIMIENTO_UP.Usuario,
                MOVIMIENTO.CAT_Tipo      = MOVIMIENTO_UP.Tipo_Catalogo;
        END IF;
        IF intEstatus = 0 then
            ROLLBACK;
            CALL laz_core.PA_CORE_Bitacoras(strModulo,strPrograma,"ErrorSQL",intId,jsonParametros, json_object("Error", strDetalle),strUsuario);
            SELECT  intId as Id,intEstatus,strCodigo,strDetalle;
        ELSE 
            CALL laz_core.PA_CORE_Bitacoras(strModulo,strPrograma,strAccion,intId,jsonAnterior,jsonParametros,strUsuario);
            Select  MOVIMIENTOS.MOV_Id As Id
            From	dai_movimientos MOVIMIENTOS
            Where	MOVIMIENTOS.MOV_Id = intId;
            COMMIT;
        END IF;
    END IF;	
    
    /*Guardar Detalle*/
    IF (strOpcion='GD') THEN
        START TRANSACTION;
        IF intId = 0 THEN
            SET strAccion = 'guardarMovimientoDetalle';
                MOV_Id,
                PRE_Id,
                CAT_Talla,
                MOD_Cantidad,
                MOD_Activo
            ) SELECT DISTINCT 
				MOVIMIENTO_DETALLE.Movimiento As MOV_Id,
                MOVIMIENTO_DETALLE.Prenda     As PRE_Id,
                MOVIMIENTO_DETALLE.Talla      As CAT_Talla,
                MOVIMIENTO_DETALLE.Cantidad   As MOD_Cantidad,
                1                             As MOD_Activo
            FROM JSON_TABLE (jsonParametros, '$.Embarque'
                COLUMNS (
						Movimiento  bigint PATH '$.Movimiento',
                        Prenda      bigint PATH '$.Prenda',
                        Talla       bigint PATH '$.Talla',
                        Cantidad    bigint PATH '$.Cantidad'
                    )
                ) AS MOVIMIENTO_DETALLE;
            SET intId = LAST_INSERT_ID();
        ELSE
			SET strAccion='actualizarMovimientoDetalle';
            Select json_object ("MOD_Id", MOVIMIENTOS_DETALLE.MOD_Id,
								"MOV_Id", MOVIMIENTOS_DETALLE.MOV_Id,
								"PRE_Id", MOVIMIENTOS_DETALLE.PRE_Id,
								"CAT_Talla", MOVIMIENTOS_DETALLE.CAT_Talla,
								"MOD_Cantidad", MOVIMIENTOS_DETALLE.MOD_Cantidad,
								"MOD_Activo", MOVIMIENTOS_DETALLE.MOD_Activo)
			From dai_movimientos_detalle MOVIMIENTOS_DETALLE
			Where MOVIMIENTOS_DETALLE.MOD_Id = intId;

			Update dai_movimientos_detalle MOVIMIENTOS_DETALLE
			Join ( select
				    Id,
					Movimiento,
					Prenda,
					Talla,
					Cantidad
			FROM JSON_TABLE(jsonParametros, '$.Embarque'
				COLUMNS (
                    Id          bigint PATH '$.Id',
					Movimiento  bigint PATH '$.Movimiento',
					Prenda      bigint PATH '$.Prenda',
					Talla       bigint PATH '$.Talla',
					Cantidad    bigint PATH '$.Cantidad'
				)
			) AS MOVIMIENTOS_DETALLE_UP )  AS MOVIMIENTOS_DETALLE_UP 
				  on MOVIMIENTOS_DETALLE.MOD_Id = MOVIMIENTOS_DETALLE_UP.Id
			SET MOVIMIENTOS_DETALLE.MOV_Id       = MOVIMIENTOS_DETALLE_UP.Movimiento,
                MOVIMIENTOS_DETALLE.PRE_Id       = MOVIMIENTOS_DETALLE_UP.Prenda,
                MOVIMIENTOS_DETALLE.CAT_Talla    = MOVIMIENTOS_DETALLE_UP.Talla,
                MOVIMIENTOS_DETALLE.MOD_Cantidad = MOVIMIENTOS_DETALLE_UP.Cantidad;
        END IF;
        IF intEstatus = 0 then
            ROLLBACK;
            CALL laz_core.PA_CORE_Bitacoras(strModulo,strPrograma,"ErrorSQL",intId,jsonParametros, json_object("Error", strDetalle),strUsuario);
            SELECT  intId as Id,intEstatus,strCodigo,strDetalle;
        ELSE 
            CALL laz_core.PA_CORE_Bitacoras(strModulo,strPrograma,strAccion,intId,jsonAnterior,jsonParametros,strUsuario);
            Select  EMBARQUE.EMB_Id     As Id
            From	dai_embarque EMBARQUE
            Where	EMBARQUE.EMB_Id = intId;
            COMMIT;
        END IF;
    END IF;	
    
    /* DESACTIVAR EMBARQUE */
    If (strOpcion = 'D') Then
        START TRANSACTION;
        Update dai_movimientos EMBARQUE
                Join ( Select Id 
                FROM JSON_TABLE(jsonParametros, 
                    '$.Embarque' COLUMNS (
                        Id  bigint PATH '$.Id'
                    )
                ) AS EMBARQUE_UP ) AS EMBARQUE_UP 
                    On EMBARQUE.MOV_Id = EMBARQUE_UP.Id
                SET EMBARQUE.MOV_Activo = 0;
            IF intEstatus = 0 then
                ROLLBACK;
                CALL laz_core.PA_CORE_Bitacoras(strModulo, strPrograma, "ErrorSQL", intId, jsonParametros, json_object("Error", strDetalle), strUsuario);
                SELECT  intId, intEstatus, strCodigo, strDetalle;
            ELSE 
                CALL laz_core.PA_CORE_Bitacoras(strModulo, strPrograma, strAccion, intId, jsonAnterior, jsonParametros, strUsuario);
                Select intId As Id;
                COMMIT;
        END IF;
    END IF;
    
    /* DESACTIVAR DETALLE EMBARQUE */
    If (strOpcion = 'DD') Then
        START TRANSACTION;
        Update dai_movimientos_detalle EMBARQUE
                Join ( Select Id 
                FROM JSON_TABLE(jsonParametros, 
                    '$.Embarque' COLUMNS (
                        Id  bigint PATH '$.Id'
                    )
                ) AS EMBARQUE_UP ) AS EMBARQUE_UP 
                    On EMBARQUE.MOD_Id = EMBARQUE_UP.Id
                SET EMBARQUE.MOD_Activo = 0;
            IF intEstatus = 0 then
                ROLLBACK;
                CALL laz_core.PA_CORE_Bitacoras(strModulo, strPrograma, "ErrorSQL", intId, jsonParametros, json_object("Error", strDetalle), strUsuario);
                SELECT  intId, intEstatus, strCodigo, strDetalle;
            ELSE 
                CALL laz_core.PA_CORE_Bitacoras(strModulo, strPrograma, strAccion, intId, jsonAnterior, jsonParametros, strUsuario);
                Select intId As Id;
                COMMIT;
        END IF;
    END IF;
END//
DELIMITER ;

